import React from "react";
import logo from "../img/logo192.png";


export default function Navbar() {
    return (
        <div className="navbar">
            <img src={logo}/>
            <ul className="nav-menu">
                <li>Sign Up</li>
                <li>Sign In</li>
                <li>Profile</li>
            </ul>
        </div>
    )
}
